import React from 'react';
import PropTypes from 'prop-types';

function Food({fav, img, rating}){
  return <div>
            <h1>I Loveeeee {fav}</h1>
            <h4>{rating}/5</h4>
            <img src={img}></img>
         </div>
}

Food.propTypes = {
	fav : PropTypes.string.isRequired,
	img : PropTypes.string.isRequired,
	ration : PropTypes.number.isRequired
}

const foodILike = [
  {id:1,
   name:"kimche",
   image:"data:image/jpeg;base64,",
   rating :5
  },
  {id:2,
   name:"kimbap",
   image:"data:image/jpeg;base64,",
   rating :4.9
  }
]


function App() {
  return (
    <div>
      {foodILike.map(dish => <Food key={dish.id} fav={dish.name} img={dish.image} rating={dish.rating} />)}
    
    </div>
  );
}

export default App;
